メンテナンスを変える新スタイル。まったく新しいコンセプトのキャリーバッグタイプのツールケース<br>
●スタイリッシュに工具を持ち運べる新提案。アメリカ・カリフォルニア生まれのバッグブランド「zuca（ズーカ）」のキャリーバッグタイプケース「EKB-106ZU」を採用したセットです。<br>
●機内へハンドキャリーできる一般的なサイズ（ 3 辺の合計が115cm以下）で設計されているので、交通手段を選びません。<br>
●移動先でキャビネット、スツール、デスクとしても活用できる、高い機能性、応用性を兼ね備えています。<br>
工具はMCKB-Bにセット。さらに中身が一目でわかる大小5つのポーチ（ラベル付）が付属します。<br>
●機能的＆効率的にツール＋αの持ち運びと現場での使用を実現します。<br><br>

サイズ： 高さ51cm × 幅25cm × 奥行36cm<br>
ハンドル高さ：103cm（接地面からの伸長時：長さ2段階調節可）<br>
キャリーバッグ重さ：4.2Kg<br>
